(defdist levenshtein-abc-dist
  "Approximate Bayesian Computation distribution constructor."
  [obsstr abc-sigma]
  [dist (normal 0 abc-sigma)]
  (sample* [this] obsstr)
  (observe* [this string]
            (observe* dist (levenshtein-normalized obsstr string))))
                           
