(defdist randomwhitespacedist
  [rate]
  ;[dist (poisson rate)]
  [dist (uniform-discrete 0 1)]
  (sample* [this] (apply str (repeat (sample* dist) " ")))
  (observe* [this string] (observe* dist (count string))))
